measurements.description:
One flower and one bud on one 29.5-cm sequentially blooming inflorescence;
dorsal sepal white overlaid light green medially, heavily spotted burgundy, speckled marginally;
synsepal white overlaid light green, light burgundy veins, burgundy spots proximal 2/3;
petals light green overlaid burgundy except spotted burgundy proximally;
pouch 30-degree angle from vertical, light green overlaid burgundy;
staminode light green overlaid burgundy;
 substance medium; texture glossy.
